","/R/Calculate_Residuals.R","/R/AddiVortes.R","<expr>","/R/Propose_Tessellation.R","/R/AddiVortes.R","<expr>",null,null,"/R/Calculate_Residuals.R","/R/AddiVortes.R","<expr>",null,"/R/Cell_Indexes.R","/R/TestSet_Prediction.R","/R/AddiVortes.R","<expr>",null,null,null,null,null,null,null,"/R/Cell_Indexes.R","/R/Calculate_Residuals.R","/R/AddiVortes.R","<expr>",null,"/R/Propose_Tessellation.R","/R/AddiVortes.R","<expr>","/R/Calculate_Residuals.R","/R/AddiVortes.R","<expr>",null,null,"/R/Cell_Indexes.R","/R/TestSet_Prediction.R","/R/AddiVortes.R","<expr>"]},"interval":10,"files":[{"filename":"<expr>","content":"profvis({\n  # Run the algorithm\n  result <- AddiVortes(Y_Boston[TrainSet],X_Boston[TrainSet,],\n                       200,2000,200,6,0.85,3,0.8,3,25,\n                       Y_Boston[TestSet],X_Boston[TestSet,],\n                       IntialSigma = \"Linear\")\n})\n","normpath":"<expr>"},{"filename":"/R/AddiVortes.R","content":"#' @title AddiVortes\n#'\n#' @description\n#' The AddiVortes function is a Bayesian nonparametric regression model that uses a tessellation to model the relationship between the covariates and the output values. The model uses a backfitting algorithm to sample from the posterior distribution of the output values for each tessellation. The function returns the RMSE value for the test samples.\n#'\n#'\n#' @param y A vector of the output values.\n#' @param x A matrix of the covariates.\n#' @param m The number of tessellations.\n#' @param max_iter The number of iterations.\n#' @param burn_in The number of burn in iterations.\n#' @param nu The degrees of freedom.\n#' @param q The quantile.\n#' @param k The number of centers.\n#' @param sd The standard deviation.\n#' @param Omega The prior probability of adding a dimension.\n#' @param lambda_rate The rate of the Poisson distribution for the number of centers.\n#' @param yTest A vector of the output values for the test set.\n#' @param xTest A matrix of the covariates for the test set.\n#' @param IntialSigma The method used to calculate the initial sigma.\n#' @param thinning The thinning rate.\n#'\n#' @return The RMSE value for the test samples.\n#'\n#' @export\nAddiVortes <- function(y, x, m = 200, max_iter = 1200, burn_in = 200, nu = 6, q = 0.85, k = 3, sd = 0.8, Omega = 3, lambda_rate = 25, yTest, xTest, IntialSigma = \"Linear\", thinning = 1) {\n  # Scaling x and y\n  y_scaling_result <- scale_data_internal(y)\n  yScaled <- y_scaling_result$scaled_data # Vector of values\n  y_center <- y_scaling_result$centers\n  y_range <- y_scaling_result$ranges\n\n  x_scaling_result <- scale_data_internal(x)\n  xScaled <- x_scaling_result$scaled_data # Matrix of values\n  x_centers <- x_scaling_result$centers # Vector of values\n  x_ranges <- x_scaling_result$ranges   # Vector of values\n\n  # Scaling the test set\n  xTest <- apply_scaling_internal(mat = xTest,\n                                  centers = x_centers,\n                                  ranges = x_ranges)\n\n  # Initialise:\n  # Prediction Set (A list of vectors with the output values for each tessellation),\n  # Dimension set (A list of vectors with the covariates included in the tessellations);\n  # and Tessellation Set (A list of matrices that give the\n  #                          coordinates of the centres in the tessellations)\n  Pred <- rep(list(matrix(mean(yScaled) / m)), m)\n  Dim <- vector(length = m)\n  Tess <- vector(length = m)\n  for (i in 1:m) {\n    Dim[i] <- list(sample(1:length(x[1, ]), 1))\n    Tess[i] <- (list(matrix(rnorm(1, 0, sd))))\n  }\n\n  # Prepare some variables used in the backfitting algorithm\n  SumOfAllTess <- rep(mean(yScaled),\n                      length(yScaled))\n  SigmaSquaredMu <- (0.5 / (k * sqrt(m)))^2\n  LastTessPred <- matrix\n\n  # Matrices that will hold the samples from the posterior distribution\n  # for the training samples and test samples.\n  posterior_samples <- floor((max_iter - burn_in) / thinning) + 1\n  PredictionMatrix <- array(dim = c(length(y),\n                                    posterior_samples))\n  TestMatrix <- array(dim = c(length(yTest),\n                              posterior_samples))\n\n  # finding lambda\n  if (IntialSigma == \"Naive\") {\n    # Usually used if p is greater then n. Uses Standard deviation of y to predict sigma.\n    SigmaSquaredHat <- var(yScaled)\n  } else {\n    # Default method using residual standard deviation from a least-squared linear\n    # regression of y, to predict sigma.\n    MultiLinear <- lm(yScaled ~ xScaled)\n    SigmaSquaredHat <- sum(MultiLinear$residuals^2) /\n      (length(yScaled) - length(xScaled[1, ]) - 1)\n  }\n\n  # Find lambda\n  lambda <- optim(\n    par = 1,\n    fitting_function,\n    method = \"Brent\",\n    lower = 0.001,\n    upper = 100,\n    q = q, nu = nu, sigmaSquared_hat = SigmaSquaredHat\n  )$par\n\n  # Setting up progress bar\n  pbar <- utils::txtProgressBar(min = 0, max = max_iter,\n                                style = 3, width = 50, char = \"=\")\n\n  for (i in 1:max_iter) {\n    # Sample Sigma squared using all tessellations to predict the outcome variables\n    SigmaSquared <- Sample_Sigma_Squared(yScaled,\n                                         nu,\n                                         lambda,\n                                         SumOfAllTess)\n\n    for (j in 1:m) {\n      # Propose new Tessellation\n      NewTessOutput <- Propose_Tessellation(xScaled,\n                                            j,\n                                            Tess,\n                                            Dim,\n                                            sd)\n      TessStar <- NewTessOutput[[1]]\n      DimStar <- NewTessOutput[[2]]\n      Modification <- NewTessOutput[[3]]\n\n      # Calculate the n-vector of partial residuals derived from a fitting process\n      # that excludes the jth tessellation and the number of observations in each cell.\n      ResidualsOutput <- Calculate_Residuals(yScaled, xScaled, j,\n                                             SumOfAllTess, Tess, Dim,\n                                             Pred, TessStar, DimStar,\n                                             LastTessPred)\n      # Old and New refer to the original and proposed tessellations\n      R_ijOld <- ResidualsOutput[[1]]\n      n_ijOld <- ResidualsOutput[[2]]\n      R_ijNew <- ResidualsOutput[[3]]\n      n_ijNew <- ResidualsOutput[[4]]\n      # Keeps track of the prediction for all tessellations to help sample sigma squared.\n      SumOfAllTess <- ResidualsOutput[[5]]\n      # Gives the row of each observation for the cell it falls in for the proposed tessellation.\n      IndexesStar <- ResidualsOutput[[6]]\n      # Gives the row of each observation for the cell it falls in for the original tessellation.\n      Indexes <- ResidualsOutput[[7]]\n\n      if (!any(n_ijNew == 0)) {\n        # automatically rejects proposed tessellation if there exists a cell with no observations in.\n        LogAcceptanceProb <- Acceptance_Probability(xScaled, TessStar, DimStar,\n                                                    j, R_ijOld, n_ijOld, R_ijNew,\n                                                    n_ijNew, SigmaSquared,\n                                                    Modification, SigmaSquaredMu,\n                                                    Omega, lambda_rate)\n\n        if (log(runif(n = 1)) < LogAcceptanceProb) {\n          # Accepts the proposed tessellation is accepted then calculates the new\n          # output values for the new tessellation.\n          Tess <- TessStar\n          Dim <- DimStar\n          Pred[[j]] <- Sample_mu_values(j, TessStar, R_ijNew, n_ijNew,\n                                        SigmaSquaredMu, SigmaSquared)\n          LastTessPred <- Pred[[j]][IndexesStar]\n        } else {\n          # Rejects the proposed tessellation then calculates new output values\n          # for the original tessellation.\n          Pred[[j]] <- Sample_mu_values(j, Tess, R_ijOld, n_ijOld,\n                                        SigmaSquaredMu, SigmaSquared)\n          LastTessPred <- Pred[[j]][Indexes]\n        }\n      } else {\n        # Rejects the proposed tessellation then calculates new output values for\n        # the original tessellation.\n        Pred[[j]] <- Sample_mu_values(j, Tess, R_ijOld, n_ijOld,\n                                      SigmaSquaredMu, SigmaSquared)\n        LastTessPred <- Pred[[j]][Indexes]\n      }\n      if (j == m) {\n        # If j equals m then adds the last tessellation output values\n        # to give a prediction.\n        SumOfAllTess <- SumOfAllTess + LastTessPred\n      }\n    }\n\n    # Update the progress bar\n    utils::setTxtProgressBar(pbar, i)\n\n    if (i >= burn_in & (i - burn_in) %% thinning == 0) {\n      # vectors that hold the predictions for each iteration after burn in.\n      PredictionMatrix[, 1 + (i - burn_in) / thinning] <- SumOfAllTess\n      TestMatrix[, 1 + (i - burn_in) / thinning] <- TestSet_Prediction(xTest, m, Tess, Dim, Pred)\n    }\n  }\n\n  # Close the progress bar\n  close(pbar)\n\n  # finding the mean of the prediction over the iterations and then unscaling the predictions.\n  mean_yhat <- (rowSums(PredictionMatrix) / (posterior_samples)) * y_range +\n    y_center\n  mean_yhat_Test <- (rowSums(TestMatrix) / (posterior_samples)) * y_range +\n    y_center\n\n  return( # Returns the RMSE value for the test samples.\n    data.frame(\n      In_sample_RMSE = sqrt(mean((y - mean_yhat)^2)),\n      Out_of_sample_RMSE = sqrt(mean((yTest - mean_yhat_Test)^2))\n    )\n  )\n}","normpath":"/home/johnpaul/Documents/Code/AddiVortes/R/AddiVortes.R"},{"filename":"/R/Propose_Tessellation.R","content":"#' @title Propose_Tessellation\n#'\n#' @description Propose a new tessellation by adding, removing, changing or swapping dimensions or centers.\n#'\n#' @param x A matrix of covariates.\n#' @param j The index of the tessellation to be modified.\n#' @param Tess A list of matrices of the tessellations.\n#' @param Dim A list of vectors of the dimensions of the tessellations.\n#' @param var The variance of the normal distribution used to sample new coordinates.\n#'\n#' @return A list containing the new tessellation, the new dimension matrix and the modification made.\n#'\n#' @export\nPropose_Tessellation <- function(x, j, Tess, Dim, var) { # Propose a new tessellation\n\n  p <- runif(1, 0, 1) # Randomly sample p to decide the proposed modification to tessellation.\n\n  DimStar <- Dim # Let proposed dimension matrix equal original dimension matrix.\n  TessStar <- Tess # Similar for the tessellation matrix.\n\n  if (p < 0.2 & length(Dim[[j]]) != length(x[1, ]) | length(Dim[[j]]) == 1 & p < 0.4) { # Add a dimension if p is less then 0.2 or if p is less then 0.4 when there is only one dimension in the Tessellation due to adjustments (Supplementary Material).\n    NumberOfCovariates <- 1:length(x[1, ]) # Let NumberOfCovariates be a vector from 1 to the number of covariates considered.\n    NumberOfCovariates <- NumberOfCovariates[-Dim[[j]]] # Remove all values that for the covariates that are already in the tessellation.\n    DimStar[[j]] <- c(Dim[[j]], sample(NumberOfCovariates, 1)) # Uniformly sample a new covariate and add it to the dimension matrix.\n    TessStar[[j]] <- cbind(Tess[[j]], rnorm(length(Tess[[j]][, 1]), 0, var)) # Sample new coordinates from Normal distribution for the new dimension and add it to the Tessellation matrix.\n    Modification <- \"AD\"\n  } else if (p < 0.4) { # Remove a dimension if p is less then 0.4.\n    RemovedDim <- sample(1:length(Dim[[j]]), 1) # Uniformly sample the dimension to be removed.\n    DimStar[[j]] <- DimStar[[j]][-RemovedDim] # Remove the dimension from the dimesion Matrix.\n    TessStar[[j]] <- matrix(TessStar[[j]][, -RemovedDim], ncol = length(DimStar[[j]])) # Remove the coordinates in the Tessellation matrix corresponding to the dimension removed.\n    Modification <- \"RD\"\n  } else if (p < 0.6 || p < 0.8 & length(Tess[[j]][, 1]) == 1) { # Add a centre if p is less then 0.6 or if p is less then 0.4 when there is only one center in the Tessellation due to adjustments (Supplementary Material).\n    TessStar[[j]] <- rbind(Tess[[j]], rnorm(length(Dim[[j]]), 0, var)) # Add a new row of coordinates, sampled from a normal distribution, to the Tessellation matrix to add a center.\n    Modification <- \"AC\"\n  } else if (p < 0.8) { # Add a centre if p is less then 0.8.\n    CenterRemoved <- sample(1:length(TessStar[[j]][, 1]), 1) # Sample a row.\n    TessStar[[j]] <- matrix(TessStar[[j]][-CenterRemoved, ], ncol = length(Dim[[j]])) # Remove row sampled.\n    Modification <- \"RC\"\n  } else if (p < 0.9 || length(Dim[[j]]) == length(x[1, ])) { # Change a center if p is less then 0.9 or if the all the covariates are in the tessellation.\n    TessStar[[j]][sample(1:length(TessStar[[j]][, 1]), 1), ] <- rnorm(length(Dim[[j]]), 0, var) # Sample a row in the tessellaion matrix and change the coordinates of the centre by sampling from a normal distribution.\n    Modification <- \"Change\"\n  } else { # Swop a dimension.\n    NumberOfCovariates <- 1:length(x[1, ]) # Let NumberOfCovariates be a vector from 1 to the number of covariates considered.\n    NumberOfCovariates <- NumberOfCovariates[-Dim[[j]]] # Remove all values that for the covariates that are already in the tessellation.\n    DimToChange <- sample(1:length(Dim[[j]]), 1) # Uniformly sample a dimension to change.\n    DimStar[[j]][DimToChange] <- sample(NumberOfCovariates, 1) # Replace the Dimension to a new uniforly sampled covariate that is not already in the tessellaion.\n    TessStar[[j]][, DimToChange] <- rnorm(length(Tess[[j]][, 1]), 0, var) # Add new normally sampled coordinates new dimension added.\n    Modification <- \"Swop\"\n  }\n\n  TessStar[[j]] <- matrix(TessStar[[j]], ncol = length(DimStar[[j]])) # Ensure the the Tessellation matrix is a \"matrix\" type.\n\n  return(list(TessStar, DimStar, Modification)) # Return new proposed tessellation.\n}","normpath":"/home/johnpaul/Documents/Code/AddiVortes/R/Propose_Tessellation.R"},{"filename":"/R/Cell_Indexes.R","content":"#' @title Cell_Indexes\n#'\n#' @description A function that gives the row (the center) of the tessellation that each observation falls within.\n#'\n#' @param x The covariate matrix.\n#' @param Tess The tessellation.\n#' @param Dim The dimensions of the tessellation.\n#'\n#' @return The row (the center) of the tessellation that each observation falls within.\nCell_Indexes <- function(x, Tess, Dim) {\n  if (length(Tess[, 1]) == 1) { # only 1 centre\n    CellsForGivenTess <- rep(1, length(x[, 1]))\n  } else { # multiple\n    CellsForGivenTess <- knnx.index(Tess,\n                                    matrix(x[, Dim],\n                                           ncol = length(Dim)), 1)\n  }\n  return(CellsForGivenTess)\n}","normpath":"/home/johnpaul/Documents/Code/AddiVortes/R/Cell_Indexes.R"},{"filename":"/R/Calculate_Residuals.R","content":"#' @title Calculate_Residuals\n#'\n#' @description A function that calculates the n-vector of partial residuals derived from a fitting process that excludes the jth tessellation.\n#'\n#' @param y The outcome variable.\n#' @param x The covariate matrix.\n#' @param j The index of the tessellation.\n#' @param SumOfAllTess The sum of all tessellations.\n#' @param Tess The tessellation.\n#' @param Dim The dimensions of the tessellation.\n#' @param Pred The prediction set.\n#' @param TessStar The proposed tessellation.\n#' @param DimStar The proposed dimensions.\n#' @param LastTessPred The last tessellation prediction.\n#'\n#' @return A list containing the residuals of the old tessellation, the number of observations in each cell of the old tessellation, the residuals of the new tessellation, the number of observations in each cell of the new tessellation, the sum of all tessellations, the indexes of the proposed tessellation, and the indexes of the original tessellation.\n#'\n#' @export\nCalculate_Residuals <- function(y, x, j, SumOfAllTess, Tess, Dim,\n                                Pred, TessStar, DimStar, LastTessPred) {\n  if (j == 1) {\n    indexes <- Cell_Indexes(x, Tess[[j]], Dim[[j]])\n    CurrentTessPred <- Pred[[j]][indexes]\n    SumOfAllTess <- SumOfAllTess - CurrentTessPred\n  } else {\n    indexes <- Cell_Indexes(x, Tess[[j]], Dim[[j]])\n    CurrentTessPred <- Pred[[j]][indexes]\n    SumOfAllTess <- SumOfAllTess + LastTessPred - CurrentTessPred\n  }\n\n  IndexesStar <- Cell_Indexes(x, TessStar[[j]], DimStar[[j]])\n  R_j <- y - SumOfAllTess\n\n  # Initializing Sizes\n\n  R_ijOld <- rep(0, length(Pred[[j]]))\n  n_ijOld <- rep(0, length(Pred[[j]]))\n\n  for (i in 1:length(Pred[[j]])) {\n    R_ijOld[i] <- sum(R_j[indexes == i])\n    n_ijOld[i] <- sum(indexes == i)\n  }\n\n  R_ijNew <- rep(0, length(TessStar[[j]][, 1]))\n  n_ijNew <- rep(0, length(TessStar[[j]][, 1]))\n\n  for (i in 1:length(TessStar[[j]][, 1])) {\n    R_ijNew[i] <- sum(R_j[IndexesStar == i])\n    n_ijNew[i] <- sum(IndexesStar == i)\n  }\n\n  return(list(R_ijOld, n_ijOld,\n              R_ijNew, n_ijNew,\n              SumOfAllTess, IndexesStar, indexes))\n}","normpath":"/home/johnpaul/Documents/Code/AddiVortes/R/Calculate_Residuals.R"},{"filename":"/R/Sample_mu_values.R","content":"#' @title Sample_mu_values\n#'\n#' @description This function samples the new mean output values for the proposed tessellation.\n#'\n#' @param j The index of the tessellation.\n#' @param Tess The tessellation.\n#' @param R_ijNew The new R_ij values.\n#' @param n_ijNew The new n_ij values.\n#' @param sigmaSquaredMu The sigma squared mu value.\n#' @param SigmaSquared The Sigma squared value.\n#'\n#' @return The new output values for the new tessellation.\n#'\n#' @export\nSample_mu_values <- function(j, Tess, R_ijNew, n_ijNew, sigmaSquaredMu, SigmaSquared) {\n  # 1. Get the number of samples needed\n  N <- length(Tess[[j]][, 1]) # Or nrow(Tess[[j]])\n\n  # 2. Calculate the vector of means for rnorm\n  denominator_vec <- sigmaSquaredMu * n_ijNew + SigmaSquared\n  mean_vec <- (sigmaSquaredMu * R_ijNew) / denominator_vec\n\n  # 3. Calculate the vector of standard deviations for rnorm\n  #    Calculate variance first for clarity, then sqrt\n  #    Ensure SigmaSquared, sigmaSquaredMu are non-negative as expected for variances\n  variance_vec <- (SigmaSquared * sigmaSquaredMu) / denominator_vec\n  # Handle potential negative variance if inputs aren't guaranteed non-negative,\n  # though typically variance terms are >= 0. sqrt() will produce NaN for negative input.\n  sd_vec <- sqrt(variance_vec)\n\n  # 4. Call rnorm once with vector arguments\n  return(rnorm(n = N,\n               mean = mean_vec,\n               sd = sd_vec))\n}","normpath":"/home/johnpaul/Documents/Code/AddiVortes/R/Sample_mu_values.R"},{"filename":"/R/Acceptance_Probability.R","content":"#' @title Acceptance Probability\n#'\n#' @description Calculates the acceptance rate of the proposed tessellation.\n#'\n#' @param x The covariate matrix.\n#' @param Tess The tessellation.\n#' @param Dim The dimensions of the tessellation.\n#' @param j The index of the tessellation.\n#' @param R_ijOld The residuals of the old tessellation.\n#' @param n_ijOld The number of observations in each cell of the old tessellation.\n#' @param R_ijNew The residuals of the new tessellation.\n#' @param n_ijNew The number of observations in each cell of the new tessellation.\n#' @param SigmaSquared The variance of the residuals.\n#' @param Modification The type of modification.\n#' @param SigmaSquaredMu The variance of the random effects.\n#' @param Omega The prior probability of adding a dimension.\n#' @param lambda_rate The rate of the Poisson distribution for the number of centers.\n#'\n#' @return The acceptance probability.\n#'\n#' @export\nAcceptance_Probability <- function(x, Tess, Dim, j, R_ijOld, n_ijOld, R_ijNew, n_ijNew, SigmaSquared,\n                                   Modification, SigmaSquaredMu, Omega, lambda_rate) {\n  d <- length(Dim[[j]])\n  NumCovariates <- length(x[1, ])\n  cStar <- length(Tess[[j]][, 1])\n\n  # The Log Likelihood Ratio in the acceptance ratio\n  LOGlikelihoodRatio <- 0.5 * (log(prod(n_ijOld * SigmaSquaredMu + SigmaSquared)) -\n                                 log(prod(n_ijNew * SigmaSquaredMu + SigmaSquared))) +\n    ((SigmaSquaredMu / (2 * SigmaSquared)) * (sum((R_ijNew^2) /\n                                                    (n_ijNew * SigmaSquaredMu + SigmaSquared)) -\n                                                sum((R_ijOld^2) / (n_ijOld * SigmaSquaredMu + SigmaSquared))))\n\n  # Calculating the acceptance probability for\n  # \"AD\"=Adding a dimension, \"RD\"=Removing a dimension,\n  # \"AC\"=Adding a center, \"RC\"=Removing a center,\n  # \"Change\"=Changing the coordinates of a center and Swopping a dimension.\n  if (Modification == \"AD\") {\n    TessStructure <- (dbinom(d - 1, NumCovariates - 1, Omega / NumCovariates)) /\n      (dbinom(d - 2, NumCovariates - 1, Omega / NumCovariates) * (NumCovariates - d + 1))\n    TransitionRatio <- (NumCovariates - d + 1) / d\n    AcceptanceProb <- LOGlikelihoodRatio + log(TessStructure) + log(TransitionRatio)\n\n    # Adjustments.\n    if (length(Dim[[j]]) == 1) {\n      AcceptanceProb <- AcceptanceProb + log(1 / 2)\n    } else if (length(Dim[[j]]) == NumCovariates - 1) {\n      AcceptanceProb <- AcceptanceProb + log(2)\n    }\n  } else if (Modification == \"RD\") {\n    TessStructure <- (dbinom(d - 1, NumCovariates, Omega / NumCovariates) * (NumCovariates - d)) /\n      (dbinom(d, NumCovariates, Omega / NumCovariates))\n    TransitionRatio <- (d + 1) / (NumCovariates - d)\n    AcceptanceProb <- LOGlikelihoodRatio + log(TessStructure) + log(TransitionRatio)\n\n    # Adjustments.\n    if (length(Dim[[j]]) == NumCovariates) {\n      AcceptanceProb <- AcceptanceProb + log(1 / 2)\n    } else if (length(Dim[[j]]) == 2) {\n      AcceptanceProb <- AcceptanceProb + log(2)\n    }\n  } else if (Modification == \"AC\") {\n    TessStructure <- dpois(cStar - 1, lambda_rate) / dpois(cStar - 2, lambda_rate)\n    TransitionRatio <- 1 / cStar\n    AcceptanceProb <- LOGlikelihoodRatio + log(TessStructure) + log(TransitionRatio) + 0.5 * log(SigmaSquared)\n\n    # Adjustments.\n    if (cStar == 1) {\n      AcceptanceProb <- AcceptanceProb + log(1 / 2)\n    }\n  } else if (Modification == \"RC\") {\n    TessStructure <- dpois(cStar - 1, lambda_rate) / dpois(cStar, lambda_rate)\n    TransitionRatio <- cStar + 1\n    AcceptanceProb <- LOGlikelihoodRatio + log(TessStructure) +\n      log(TransitionRatio) - 0.5 * log(SigmaSquared)\n\n    # Adjustments.\n    if (cStar == 2) {\n      AcceptanceProb <- AcceptanceProb + log(2)\n    }\n  } else if (Modification == \"Change\") {\n    TessStructure <- 1\n    TransitionRatio <- 1\n    AcceptanceProb <- LOGlikelihoodRatio + log(TessStructure) + log(TransitionRatio)\n  } else {\n    TessStructure <- 1\n    TransitionRatio <- 1\n    AcceptanceProb <- LOGlikelihoodRatio + log(TessStructure) + log(TransitionRatio)\n  }\n  return(AcceptanceProb)\n}","normpath":"/home/johnpaul/Documents/Code/AddiVortes/R/Acceptance_Probability.R"},{"filename":"/R/0_Inverse_Gamma.R","content":"#' Generate Random Deviates from the Inverse Gamma Distribution (Internal)\n#'\n#' This function generates random deviates from the inverse gamma distribution,\n#' providing the same functionality as `invgamma::rinvgamma` without adding\n#' an external dependency.\n#'\n#' The inverse gamma distribution with shape $a$ (alpha) and rate $b$ (beta)\n#' has the probability density function:\n#' $f(x) = \\frac{b^a}{\\Gamma(a)} x^{-a-1} \\exp(-b/x)$\n#' for $x > 0$, $a > 0$, $b > 0$.\n#' This implementation uses the relationship that if $Y \\sim Gamma(shape=a, rate=b)$,\n#' then $1/Y \\sim InvGamma(shape=a, rate=b)$.\n#'\n#' @param n Numeric, the number of observations required.\n#' @param shape Numeric, the shape parameter ($a$). Must be positive.\n#' @param rate Numeric, the rate parameter ($b$). Must be positive.\n#'   Cannot be specified if `scale` is specified. Defaults to 1.\n#' @param scale Numeric, the scale parameter, equivalent to `1/rate`. Must be\n#'   positive. Cannot be specified if `rate` is specified. Defaults to `1/rate`.\n#'\n#' @return A numeric vector of length `n` containing random deviates from the\n#'   Inverse Gamma(shape, rate) distribution.\n#'\n#' @references Based on the source code of `invgamma::rinvgamma` by Stefan Kloppenborg.\n#'             Relies on `stats::rgamma`.\n#'\n#' @keywords internal\n#' @noRd\n#'\nrinvgamma_internal <- function(n, shape, rate = 1, scale = 1/rate) {\n  # Check n\n  if (length(n) != 1 || !is.numeric(n) || n < 0 || floor(n) != n) {\n    stop(\"'n' must be a non-negative integer.\")\n  }\n  # Return numeric(0) if n=0, consistent with rgamma\n  if (n == 0) return(numeric(0))\n\n  # Check shape\n  if (length(shape) != 1 || !is.numeric(shape) || shape <= 0) {\n    stop(\"'shape' must be a single positive number.\")\n  }\n\n  # Handle rate vs scale parameters, ensuring only one effective parameter is used\n  # and it's positive.\n  if (!missing(rate) && !missing(scale)) {\n    if (!is.numeric(rate) || length(rate) != 1 || rate <= 0) {\n      stop(\"'rate' must be a single positive number.\")\n    }\n    if (!is.numeric(scale) || length(scale) != 1 || scale <= 0) {\n      stop(\"'scale' must be a single positive number.\")\n    }\n  }\n\n  # Determine the rate parameter to use, based on logic from invgamma source\n  if (missing(rate) && !missing(scale)) {\n    if (!is.numeric(scale) || length(scale) != 1 || scale <= 0) {\n      stop(\"'scale' must be a single positive number.\")\n    }\n    actual_rate <- 1 / scale\n  } else {\n    # Use the value 'rate' has (either user-provided or default=1)\n    if (!is.numeric(rate) || length(rate) != 1 || rate <= 0) {\n      stop(\"'rate' must be a single positive number.\")\n    }\n    actual_rate <- rate\n  }\n\n  gamma_sample <- stats::rgamma(n = n,\n                                shape = shape,\n                                rate = actual_rate)\n  inv_gamma_sample <- 1 / gamma_sample\n\n  return(inv_gamma_sample)\n}\n\n#' Calculate Quantiles of the Inverse Gamma Distribution (Internal)\n#'\n#' This function computes quantiles (the inverse CDF) of the inverse gamma distribution,\n#' providing similar functionality to potentially available functions in external packages\n#' (like `invgamma::qinvgamma`) without adding an external dependency.\n#'\n#' The inverse gamma distribution with shape $a$ (alpha) and rate $b$ (beta)\n#' has the probability density function:\n#' $f(x) = \\frac{b^a}{\\Gamma(a)} x^{-a-1} \\exp(-b/x)$\n#' for $x > 0$, $a > 0$, $b > 0$.\n#' This implementation uses the relationship that if $Y \\sim Gamma(shape=a, rate=b)$,\n#' and $Q_Y(p, lower.tail=FALSE)$ is the quantile function of $Y$ giving the value $y$\n#' such that $P(Y \\ge y) = p$, then the quantile $x$ for the inverse gamma\n#' distribution such that $P(X \\le x) = p$ is given by $x = 1 / Q_Y(p, lower.tail=FALSE)$.\n#' It relies on `stats::qgamma`.\n#'\n#' @param p Numeric vector of probabilities. Values outside $[0, 1]$ (or the\n#'  corresponding range if `log.p = TRUE`) will result in `NaN`.\n#' @param shape Numeric, the shape parameter ($a$). Must be positive.\n#' @param rate Numeric, the rate parameter ($b$). Must be positive.\n#'  Cannot be specified if `scale` is specified. Defaults to 1.\n#' @param scale Numeric, the scale parameter, equivalent to `1/rate`. Must be\n#'  positive. Cannot be specified if `rate` is specified. Defaults to `1/rate`.\n#' @param lower.tail Logical; if TRUE (default), probabilities are $P[X \\le x]$,\n#'  otherwise, $P[X > x]$.\n#' @param log.p Logical; if TRUE, probabilities p are given as log(p).\n#'\n#' @return A numeric vector of quantiles corresponding to the probabilities `p`.\n#'\n#' @references Based on the relationship between Gamma and Inverse Gamma distributions\n#'  and relies on `stats::qgamma`.\n#'\n#' @keywords internal\n#' @noRd\n#'\nqinvgamma_internal <- function(p, shape, rate = 1, scale = 1/rate, lower.tail = TRUE, log.p = FALSE) {\n  # Check shape\n  if (length(shape) != 1 || !is.numeric(shape) || shape <= 0 || !is.finite(shape)) {\n    stop(\"'shape' must be a single positive finite number.\")\n  }\n\n  # Handle rate vs scale parameters, ensuring only one effective parameter is used\n  # and it's positive and finite.\n  rate_missing <- missing(rate)\n  scale_missing <- missing(scale)\n\n  if (!rate_missing && !scale_missing) {\n    # Both provided, check consistency implicitly via default scale=1/rate\n    # Need explicit check if defaults were different or if strict error desired\n    # Using rate's value if both provided (matches rinvgamma default behaviour)\n    if (!is.numeric(rate) || length(rate) != 1 || rate <= 0 || !is.finite(rate)) {\n      stop(\"'rate' must be a single positive finite number.\")\n    }\n    actual_rate <- rate\n  } else if (rate_missing && !scale_missing) {\n    # Only scale provided\n    if (!is.numeric(scale) || length(scale) != 1 || scale <= 0 || !is.finite(scale)) {\n      stop(\"'scale' must be a single positive finite number.\")\n    }\n    actual_rate <- 1 / scale\n  } else {\n    # Use rate (either provided or default=1)\n    if (!is.numeric(rate) || length(rate) != 1 || rate <= 0 || !is.finite(rate)) {\n      stop(\"'rate' must be a single positive finite number.\")\n    }\n    actual_rate <- rate\n  }\n\n  # Check p\n  if (!is.numeric(p)) {\n    stop(\"'p' must be numeric.\")\n  }\n\n  # Vectorised calculation using stats::qgamma\n  # The quantile x for InvGamma(a, b) such that P(X <= x) = p\n  # corresponds to 1 / y where y is the quantile for Gamma(a, b)\n  # such that P(Y >= y) = p.\n  # This means y = qgamma(p, shape, rate, lower.tail = FALSE)\n  # So, x = 1 / qgamma(p, shape, rate, lower.tail = FALSE)\n\n  # Need to handle log.p and lower.tail for the input p *before* passing to qgamma\n  # stats::qgamma handles log.p and lower.tail internally, but we need the\n  # *final* target probability p (corresponding to P(X <= x)) to apply the formula.\n\n  # Let qgamma handle the log.p and lower.tail transformations on the probability\n  # Argument to qgamma needs to be the probability p for the *Gamma* distribution's\n  # upper tail (P(Y >= y)) which is numerically the same as the probability p\n  # for the *Inverse Gamma* distribution's lower tail (P(X <= x)).\n  # So we pass p directly to qgamma, but specify lower.tail=FALSE\n\n  # Handle edge cases for p before calling qgamma which might warn or error\n  # qgamma handles p=0/p=1 (or log equivalents) correctly for lower.tail=FALSE\n  # qgamma(0, ..., lower.tail=FALSE) = Inf => 1/Inf = 0\n  # qgamma(1, ..., lower.tail=FALSE) = 0   => 1/0 = Inf\n\n  # Catch issues where p might be outside valid range after log.p/lower.tail logic\n  # This is implicitly handled by qgamma which returns NaN for invalid p\n\n  # Note: We must pass log.p to qgamma as well!\n  quantiles_gamma_upper <- stats::qgamma(p,\n                                         shape = shape,\n                                         rate = actual_rate,\n                                         lower.tail = FALSE, # Key part: P(Y >= y) = p\n                                         log.p = log.p)\n\n  # Inverse relationship\n  quantiles_invgamma <- 1 / quantiles_gamma_upper\n\n  # Explicitly set InvGamma quantile for p=0 (lower tail) to 0\n  # and p=1 (lower tail) to Inf, respecting log.p and lower.tail flags.\n\n  # Determine the effective probability values corresponding to P(X <= x)\n  if (log.p) {\n    if (any(p > 0 & !is.na(p))) {\n      warning(\"Negative values expected for p when log.p = TRUE\")\n      # qgamma will likely return NaN for p > 0 anyway\n    }\n    prob_eff <- exp(p)\n  } else {\n    if (any((p < 0 | p > 1) & !is.na(p) )) {\n      warning(\"Probabilities p are expected to be in [0, 1]\")\n      # qgamma will likely return NaN anyway\n    }\n    prob_eff <- p\n  }\n\n  if (!lower.tail) {\n    prob_eff <- 1 - prob_eff # Convert P(X > x) probability to P(X <= x) probability\n  }\n\n  # Apply edge case corrections based on effective probability P(X <= x)\n  quantiles_invgamma[prob_eff == 0] <- 0\n  quantiles_invgamma[prob_eff == 1] <- Inf\n\n  return(quantiles_invgamma)\n}","normpath":"/home/johnpaul/Documents/Code/AddiVortes/R/0_Inverse_Gamma.R"},{"filename":"/R/Sample_Sigma_Squared.R","content":"#' @title Sample Sigma Squared\n#'\n#' @description This function samples sigma squared from the inverse gamma distribution.\n#'\n#' @param yScaled A vector of scaled data.\n#' @param nu The prior degrees of freedom.\n#' @param lambda The prior scale parameter.\n#' @param SumOfAllTess The sum of all the tessellations.\n#'\n#' @return SigmaSquared The sampled sigma squared.\n#'\n#' @export\nSample_Sigma_Squared <- function(yScaled, nu, lambda, SumOfAllTess) {\n  n <- length(yScaled)\n  SigmaSquared <- rinvgamma_internal(1,\n                                     shape = (nu + n) / 2,\n                                     rate = (nu * lambda + sum((yScaled - SumOfAllTess)^2)) / 2)\n\n  return(SigmaSquared)\n}","normpath":"/home/johnpaul/Documents/Code/AddiVortes/R/Sample_Sigma_Squared.R"},{"filename":"/R/TestSet_Prediction.R","content":"#' @title TestSet_Prediction\n#'\n#' @description A function that derives a prediction for the output variable give an observation, for one iteration in AddiVortes.\n#'\n#' @param x A matrix with the observations.\n#' @param m The number of iterations in AddiVortes.\n#' @param Tess A list with the tessellations.\n#' @param Dim A list with the dimensions of the tessellations.\n#' @param Pred A list with the predictions.\n#'\n#' @return A vector with the predictions.\n#'\n#' @export\nTestSet_Prediction <- function(x, m, Tess, Dim, Pred) {\n  Prediction <- rep(0, length(x[, 1]))\n  for (j in 1:m) {\n    NewTessIndexes <- Cell_Indexes(x, Tess[[j]], Dim[[j]])\n    Prediction <- Prediction + Pred[[j]][NewTessIndexes]\n  }\n  \n  return(Prediction)\n}","normpath":"/home/johnpaul/Documents/Code/AddiVortes/R/TestSet_Prediction.R"}],"prof_output":"/home/johnpaul/Documents/Code/AddiVortes/.Rproj.user/9DFE44C4/profiles-cache/file5ac36fd2dfd0.Rprof","highlight":{"output":["^output\\$"],"gc":["^<GC>$"],"stacktrace":["^\\.\\.stacktraceo(n|ff)\\.\\.$"]},"split":"h"}},"evals":[],"jsHooks":[]}</script>
